<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>js--js-new</strong> is a compiled Lisp function in `<code>js.el</code>'.</br>

(js--js-new <u>CONSTRUCTOR</u> &rest <u>ARGUMENTS</u>)</br>
</br>
Call <u>CONSTRUCTOR</u> as a constructor, with arguments <u>ARGUMENTS</u>.</br>
<u>CONSTRUCTOR</u> is a JS handle, a string, or a list of these things.<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>. Content under GPL as a part of GNU Emacs.</small></body></html>
